"""#Preprocessing the Data

"""

import tensorflow as tf

def csv_reader_dataset(filepaths, repeat=None, n_readers=5,
                       n_read_threads=None, shuffle_buffer_size=10000,
                       n_parse_threads=5, batch_size=32):

    # Create a dataset of file paths
    dataset = tf.data.Dataset.list_files(filepaths).repeat(repeat)

    # Function to read lines from a CSV file, skipping the header
    def read_csv_line(filepath):
        return tf.data.TextLineDataset(filepath).skip(1)

    # Interleave the datasets from different file paths
    dataset = dataset.interleave(
        read_csv_line,
        cycle_length=n_readers,
        num_parallel_calls=n_read_threads
    )

    # Shuffle the dataset
    dataset = dataset.shuffle(shuffle_buffer_size)

    # Function to preprocess each record (replace with your custom preprocessing function)
    def preprocess(line):
        # Example preprocessing (parse CSV line into features and target)
        defaults = [tf.constant([], dtype=tf.float32)] * 30 + [tf.constant([], dtype=tf.int64)]
        parsed_line = tf.io.decode_csv(line, defaults)
        features = tf.stack(parsed_line[:-1])
        target = parsed_line[-1]
        return features, target

    # Map the preprocessing function to the dataset
    dataset = dataset.map(
        preprocess,
        num_parallel_calls=n_parse_threads
    )

    # Batch and prefetch the dataset
    dataset = dataset.batch(batch_size).prefetch(1)

    return dataset

