import tensorflow as tf
from tensorflow import keras
import numpy as np

# Extract features (X) and labels (y) from train_set
X_train = []
y_train = []
for features, label in train_set:
    X_train.append(features.numpy())
    y_train.append(label.numpy())
X_train = np.array(X_train)
y_train = np.array(y_train)

# Extract features (X) and labels (y) from valid_set
X_valid = []
y_valid = []
for features, label in valid_set:
    X_valid.append(features.numpy())
    y_valid.append(label.numpy())
X_valid = np.array(X_valid)
y_valid = np.array(y_valid)

# Extract features (X) and labels (y) from test_set
X_test = []
y_test = []
for features, label in test_set:
    X_test.append(features.numpy())
    y_test.append(label.numpy())
X_test = np.array(X_test)
y_test = np.array(y_test)

# Assuming you have defined and compiled your model
model = keras.models.Sequential([
    keras.layers.Dense(64, activation='relu', input_shape=(30,)),
    keras.layers.Dense(1, activation='sigmoid')
])
model.compile(optimizer='adam', loss='binary_crossentropy', metrics=['accuracy'])

# Train the model
batch_size = 32
steps_per_epoch = len(X_train) // batch_size
validation_steps = len(X_valid) // batch_size
model.fit(X_train, y_train,
          steps_per_epoch=steps_per_epoch,
          epochs=10,
          validation_data=(X_valid, y_valid),
          validation_steps=validation_steps)

# Evaluate the model on the test set
test_steps = len(X_test) // batch_size
test_loss, test_accuracy = model.evaluate(X_test, y_test, steps=test_steps)
print("Test Loss:", test_loss)
print("Test Accuracy:", test_accuracy)

# Assuming you have X_new defined for prediction

# Make predictions using the model on the new data
